import React, { useEffect } from "react";
import ISidebarKeyValues from "../interfaces/ISidebarKeyValues";
import './Sidebar.scss';

type SidebarProps = {
  title: string,
  titleLink: string,
  sidebarItems: ISidebarKeyValues[]
}

const Sidebar = ({ title, titleLink, sidebarItems }: SidebarProps) => {

  let items: Array<object> = [];

  // items.push(
  //   <div>
  //     {
  //       sidebarItems.map((item) => {
  //         return (
  //           <a href={item.url}>{item.name}</a>
  //         )
  //       }
  //       )
  //     }
  //   </div>
  // )

  for (let i: number = 0; i < sidebarItems.length; i = i + 1) {
    items.push(
        <div className='row no-gutters' key={i}>
            {
                sidebarItems.slice(i, i + 2).map(
                    (d) => {
                        return (
                            <div className='col d-flex justify-content-center' key={d.id} >
                            </div>
                        )
                    }
                )
            }
        </div>
    )
}

  return (
    <>
      <div className="sidebar">
        <div className="sidebar-logo">
          <a href={titleLink}>{title}</a>
        </div>
        <div className="sidebar-item">
          {items}
        </div>
      </div>
    </>
  )
}

export default Sidebar;
